import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';

class MusicCollection extends React.Component {
    constructor(props){
        super(props);
        this.playlistCollection = [];
    }

    addPlaylistToCollection(Playlist){
        this.playlistCollection = [... this.playlistCollection, Playlist];
    }

    render(){
        return (
            <ListGroup>
                {this.playlistCollection.map((Playlist) => {
                    return (
                        <Playlist></Playlist>
                    )
                })}
            </ListGroup>
        )
    }
}

export default MusicCollection;
